/*tableset.js*/
$(document).ready(function() {

	var url = $('#table_id').attr('data-table-ajaxurl');
	table = $('#table_id').DataTable({
		responsive: true, 
		"ordering": false, //
		"searching": false, //
		"searchable": false, //ajax
		"lengthChange": false,//
		"pageLength":30,//
		"serverSide": true, //ajax
		"language": {
			"sProcessing":   "...",
			"sLengthMenu":   " _MENU_ ",
			"sZeroRecords":  "",
			"sInfo":         " _START_  _END_  _TOTAL_ ",
			"sInfoEmpty":    " 0  0  0 ",
			"sInfoFiltered": "( _MAX_ )",
			"sInfoPostFix":  "",
			"sSearch":       "",
			"sUrl":          "",
			"sEmptyTable":     "...",
			"sLoadingRecords": "...",
			"sInfoThousands":  ",",
			"oPaginate": {
				"sFirst":    "",
				"sPrevious": "",
				"sNext":     "",
				"sLast":     ""
			},
			"oAria": {
				"sSortAscending":  ": ",
				"sSortDescending": ": "
			}
		}
		,
		"ajax": {
			'url': url,
			"data": function ( v ) {
				var l = $("input[data-table-search],select[data-table-search]"),vlist='{ ',i=0;
				if(l.length>0){
					l.each(function(){
						i++;
						var n  = '"'+$(this).attr("name")+'"',val = '"'+$(this).val()+'"';
						if(val!='')vlist+=i==l.length?n+':'+val:n+':'+val+',';
					});
				}
				vlist+=' }';
				vlist=$.parseJSON(vlist);
				return $.extend( {}, v, vlist );
			}
		}
	});
	
})

/*finance_index.js*/
$(document).ready(function() {

	$(document).on('show.bs.modal',"#finance_deposit,#finance_debit",function(){
		$('.finance_from')[0].reset();
	})
	//
	$(document).on('change keyup',"[data-table-search]",function(){
		table.ajax.reload();
	})
	
	//
	$('[data-plugin="datepicker"]').datepicker({
		format:'yyyy-mm-dd',
	});
	
	//
	$('.finance_from').formValidation({
		locale:'zh_CN',
		framework: "bootstrap"
	})
	.on('success.form.fv', function(e, data) {
		e.preventDefault();
		var $form    = $(e.target),
			formData = new FormData(),
			params   = $form.serializeArray();
		$.each(params, function(i, val) {
			formData.append(val.name, val.value);
		});
		$.ajax({
			url: $form.attr('action'),
			data: formData,
			cache: false,
			contentType: false,
			processData: false,
			type: 'POST',
			dataType:'json',
			success: function(result) {
				if(result.error){
					alertify.error(result.error);
				}else if(result.success){
					alertify.success(result.success);
					table.ajax.reload();
					$("#finance_deposit,#finance_debit").modal('hide');
				}
			}
		});
	});
	
});


